import React, { useState, useEffect } from 'react'
import styled from 'styled-components'
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import AccountCircleOutlinedIcon from '@material-ui/icons/AccountCircleOutlined';


const Landing = () => {
  return (
    <Container>
        <SlideOne>
          <div className="nav">
            <div className="logo">
              <div className="image"><img src="https://avatars.githubusercontent.com/u/100950301?s=280&v=4" alt="" /></div>
              <div className="text">
                <div className="product-name">Vision Bridge</div>
                <div className="team-name">Hackathon project by team SUWI</div>
              </div>
            </div>
            <div className="sign-in">
              <div className="link-text">Sign in</div>
              <div className="icon"><AccountCircleOutlinedIcon style={{ fontSize: '2rem', fill: '#333' }}/></div>
            </div>
          </div>
          <div className="main">
            <div className="text">
              <div className='product-name'>Vision Bridge</div>
              <h2>Helping to break down barriers for the visually impaired and create new opportunities for independence.</h2>
              <div className="btns">
                <div className="btn">Launch Product</div>
                <div className="btn">Family Member</div>
              </div>
            </div>
            <div className="image">
              <img src="https://im.indiatimes.in/media/content/2018/Feb/_1518700069.jpg" alt="" />
            </div>
          </div>
          <DancerDownIcon>
            <ExpandMoreIcon style={{ fontSize: '2rem', fill: '#333' }} />
          </DancerDownIcon>
        </SlideOne>
    </Container>
  )
}

export default Landing

const Container = styled.div`

`

const SlideOne = styled.div`
  width: 100vw;
  height: 100vh;
  min-height: 500px;
  /* background: #0B2447; */


  .nav{
    height: 65px;
    border-bottom: 1px solid black;
    display: flex;
    align-items: center;
    padding: 0 60px;
    justify-content: space-between;

    .logo{
      display: flex;  
      align-items: center;

      .image{
        height: 50px;
        margin-right: 10px;
        img{
          height: 100%;
        }
      }

      .text{
        .product-name{
          font-size: 1.25rem;
          font-weight: 500;
        }

        .team-name{
          font-size: 0.75rem;
          font-weight: 300;
        }
      }

      .sign-in{
        display: flex;
        flex-direction: row;

        .link-text{
          font-size: 0.8rem;
          font-weight: 300;
        }

        .icon{
          svg{
            font-size: 3rem;
            height: 2rem;
            fill: blue;
          }
        }
      }
    }
  }

  .main{
    height: calc(100vh - 70px);
    min-height: calc(500px - 70px);
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 60px;

    .text{
      margin-right: 30px;
      display: flex;
      flex-direction: column;
      align-items: flex-start;

      .product-name{
        font-size: 1rem;
        /* background-color: #333; */
        /* color: white; */
        /* padding: 10px 15px; */
        letter-spacing: 0.1rem;
        margin-bottom: 10px;
      }

      h2{
        font-weight: 400;
        font-size: 1.75rem;
        letter-spacing: 0.1rem;
      }

      .btns{
        display: flex;

        .btn{
          font-size: 0.8rem;
          background-color: #333;
          color: white;
          padding: 10px 15px;
          letter-spacing: 0.1rem;
          margin-top: 60px;
          margin-right: 10px;
          cursor: pointer;
        }
      }


    }

    .image{
      img{
        width: calc(45vw - 30px);
      }
    }
  }
`

const DancerDownIcon = styled.div`
    position: absolute;
    bottom: 50px;
    width: 98%;
    display: grid;
    place-items: center;
    animation: animateDown infinite 1.5s;

    @keyframes animateDown{
        0%, 20%, 50%, 80%, 100%{
            transform: translateY(0);
        }
        40%{
            transform: translateY(5px);
        }
        60%{
            transform: translateY(3p);
        }
    }
    @media only screen and (max-width: 600px){
        bottom: 10px;
    }
`

const SliderWrapper = styled.div`
  position: relative;
`;

const SliderLine = styled.div`
  position: absolute;
  bottom: 0;
  left: 0;
  right: 0;
  height: 5px;
  background-color: #ccc;
`;

const SliderProgress = styled.div`
  height: 100%;
  width: ${({ progress }) => progress}%;
  background-color: #ff0000;
`;
